import styled from "styled-components";
import React from "react";
import Avartar1 from "../../dummyResources/Avartar1.png";

interface Props {}

const HeaderFeedPage = styled.div`
  width: 100%;
  padding: 15px;
  font-size: 30px;
  font-weight: 800;
  display: flex;
  justify-content: space-between;
`;

const ContainerFeedPage = styled.div`
  width: 100%;
`;

const AvartarImg = styled.img`
  width: 30px;
  height: 30px;
  border-radius: 50%;
`;

export default function FeedPage(props: Props) {
  return (
    <ContainerFeedPage>
      <HeaderFeedPage>안암에서</HeaderFeedPage>
      <AvartarImg src={Avartar1} />
      <div>
        <h1>Feed Page</h1>
      </div>
      <ul>
        <li>
          <a></a>
        </li>
      </ul>
    </ContainerFeedPage>
  );
}
